import { useState, useEffect } from "react"
import axios from "axios"


const useFetch = (url) => {
  const [data, setData] = useState(null)

  useEffect(()=>{
      axios.get(url)
      .then((response)=>{
          console.log(response.data)
          setData(response.data)
      })
      .catch((error)=>{
          console.log(error.message)
      })

  },[])

  return [data]

}

export default useFetch;
